This is the official music video for 'Anyway How', the second single release from Secret Friend's groundbreaking second album 'Sleeper'.

Secret Friend hails from the mountains of northern Thailand. On 'Sleeper', a unique combination of melodic pop, traditional power-pop vocal/guitar arrangements, and contemporary downtempo Electronica production create an exciting array of trippy ear worms quite unlike anything you've heard before. Each track on the album are accompanied by music videos produced by innovative animators and film makers from around the world.  
